var b="url",c="车牌认证平台.html",d="generationDate",e=new Date(1504516770447.46),f="isCanvasEnabled",g=false,h="isAdaptiveEnabled",i="variables",j="OnLoadVariable",k="page",l="packageId",m="008de38bf80b4ceba06b7cb4144b3e80",n="type",o="Axure:Page",p="name",q="车牌认证平台",r="notes",s="style",t="baseStyle",u="627587b6038d43cca051c114ac41ad32",v="pageAlignment",w="near",x="fill",y="fillType",z="solid",A="color",B=0xFFF2F2F2,C="image",D="imageHorizontalAlignment",E="imageVerticalAlignment",F="imageRepeat",G="auto",H="favicon",I="sketchFactor",J="0",K="colorStyle",L="appliedColor",M="fontName",N="Applied Font",O="borderWidth",P="adaptiveStyles",Q="interactionMap",R="diagram",S="objects",T="id",U="a519ec1143cc4449a54ba5961cba192b",V="label",W="",X="friendlyType",Y="Rectangle",Z="vectorShape",ba="styleType",bb="visible",bc=true,bd="size",be="width",bf=2086,bg="height",bh=1569,bi="4b7bfc596114427989e10bb0b557d0ce",bj=0xFFE4E4E4,bk="borderFill",bl=0xFFFFFF,bm="location",bn="x",bo=-166,bp="y",bq=-16,br="imageOverrides",bs="66e964772dfa4b4681287713bd1fae6d",bt="isContained",bu="richTextPanel",bv="paragraph",bw="images",bx="normal~",by="images/车牌认证平台/u2478.png",bz="generateCompound",bA="70d178f130fa488ea4eb90c9c68499e0",bB=1920,bC=70,bD=0xFFF5F5F5,bE="be046b9cf44344eb8dffb9b071f2d33a",bF="images/车牌认证平台/u2480.png",bG="d33b1ab0e1c541e88533d9a6822a67cc",bH=1318,bI=1410,bJ=293,bK=110,bL="ebad5cdb1d624958bd7c2e61738c6fdd",bM="annotation",bN="Note",bO="<p><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';\">广告的逻辑：</span></p><p><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';\">默认为某个通用的标准的消息推送</span></p><p><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';\">可以通过子集的形式为停车场创建特殊的消息推送广告，但当子集广告被暂停、删除的时候，需要恢复为默认的广告形式；</span></p><p><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';\"><br></span></p><p><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';\">广告标题、广告链接、广告位（入场、出场、临停支付、月卡支付、到期续费）、有效时间（永久、有时长限制）、创建人、创建时间、状态、类型</span></p><p><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';\"><br></span></p><p><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';\">操作：新增、删除、修改、启用</span></p><p><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';\"><br></span></p><p><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';\">广告的广告位类型：</span></p><p><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';\">默认选择所有广告位，可自定义选择某个单独的广告位；</span></p><p><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';\">若停车场先前已有广告位，后续添加的广告将覆盖先前的广告，在覆盖前需要提醒用户是否确认覆盖</span></p><p><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';\"><br></span></p><p><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';\">广告的停车场类型：</span></p><p><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';\">通用或者标准类型：面向所有停车场，长期，所有广告位</span></p><p><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';\">分类或分组类型：面向物业企业，有统一可分组的标识，可设定某段时间内有效，后续恢复为通用或者标准类型；（或者还是重新设置吧）</span></p><p><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';\">单一设置类型：面向单一停车场进行设置，可设定某段时间内有效，后续恢复为通用或者标准类型；（或者还是重新设置吧）</span></p><p><span style=\"font-family:'PingFangSC-Regular', 'PingFang SC';\"><br></span></p>",bP="images/车牌认证平台/u2482.png",bQ="c8159db0104d435391bd0ccb6b39110b",bR="fontWeight",bS="650",bT=181,bU=28,bV="b3a15c9ddde04520be40f94c8168891e",bW=22,bX="fontSize",bY="20px",bZ="foreGroundFill",ca=0xFF515151,cb="opacity",cc=1,cd="'PingFangSC-Semibold', 'PingFang SC Semibold', 'PingFang SC'",ce="a41b74e6595f4869a27196f26fecbd92",cf="5b7b6c6a92d543e1bd99157b02793e65",cg=47,ch=20,ci="197dc2f582cb49d4b6551bedafb6c7a3",cj=1561,ck=40,cl="6656e4ee75f840aebfb6acf349b92ed9",cm="152c92c4951f421fb860e4150576b2b9",cn="Image",co="imageBox",cp="fa821e1c6d224675a29b9ffe1534c23c",cq=1446,cr="eabdf2fcba524d448a374fb1e83647b1",cs="images/车牌认证平台/u2488.png",ct="5111bf9977274079b8ef4c4b515414bf",cu=57,cv=1496,cw="a2735fe5676a4a12881228ecad71bdd7",cx="1a1258977f2544439fa18cadf4da31e8",cy=46,cz=15,cA=0xFFFFFFFF,cB=0